import { PropsWithChildren } from "react";
import Sidenav from "shared/components/navigation/sidenav";

const Layout: React.FC<PropsWithChildren> = (props) => {
  return (
    <div id="wrapper">
        <Sidenav />
      <div id="page-wrapper" className="full--width">
        {props.children}
      </div>
    </div>
  );
};

export default Layout;
